import * as CommonStyles from '../styles/common-styles';
import InfoBox from './InfoBox';
import React from 'react';

type ContainImageProps = {
    imgPath: string;
};

export default class ContainImage extends React.Component<ContainImageProps, any> {
    props: ContainImageProps;

    constructor(props: ContainImageProps) {
        super(props);
        this.props = props;
    }

    containerStyle = () => {
        return {
            ...CommonStyles.ImageCoverPartial(this.props.imgPath),
            width: '40%',
            padding: '20% 5% 3% 5%'
        };
    };

    render = () => {
        return (
            <div style={this.containerStyle()}>
                <InfoBox title="Club Bonding" buttonText="Club Events" width="50%">
                    We are more than just a ski club. We're a group of closely knit people who want
                    to make lifelong friends and have a great time! Check below to see if we have
                    any events that interest you!
                </InfoBox>
            </div>
        );
    };
}
